package rc.ds.string;

import java.io.BufferedReader;
import java.io.InputStreamReader;

public class SuperDigit {
	public static void main(String[] args) throws Exception {
		BufferedReader in = new BufferedReader(new InputStreamReader(System.in));

		String actualNo = "";
		int repeat = Integer.parseInt(in.readLine());

		String calculatedNo = (totalValue(actualNo) * repeat)+"";

		System.out.println("calculate no " + calculatedNo);

		System.out.println(calculateSuperDigit(calculatedNo));
	}

	private static int calculateSuperDigit(String number) {

		int superDigit = totalValue(number);
		if (superDigit > 9) {
			superDigit = calculateSuperDigit(superDigit + "");
		}
		return superDigit;
	}

	private static int totalValue(String number) {

		int sum = 0;

		if (number.length() != 0) {
			sum = Integer.parseInt(number.charAt(0) + "");
			sum += totalValue(number.substring(1, number.length()));
		}
		return sum;
	}

	private static String prepareNo(String actualNo, int repeat) {
		if (repeat < 1) {
			return "";
		}

		return actualNo + prepareNo(actualNo, repeat - 1);
	}

}
/*
Problem Statement

We define super digit of an integer x using the following rules:

    Iff x has only 1 digit, then its super digit is x.
    Otherwise, the super digit of x is equal to the super digit of the digit-sum of x. Here, digit-sum of a number is defined as the sum of its digits.

For example, super digit of 9875 will be calculated as:

super-digit(9875) = super-digit(9+8+7+5) 
                  = super-digit(29) 
                  = super-digit(2+9)
                  = super-digit(11)
                  = super-digit(1+1)
                  = super-digit(2)
                  = 2.

You are given two numbers - n k. You have to calculate the super digit of P.

P is created when number n is concatenated k times. That is, if n = 123 and k = 3, then P = 123123123. */